import React, { Component } from 'react';

class editablecell extends Component {
    render() {
        return (
            <div>
                <td>
                    <input type="text" name={this.props.cellData.type} id={this.props.cellData.id} value={this.props.cellData.value} onChange={this.props.onInvoiceTableUpdate} />
                </td>
            </div>
        );
    }
}

export default editablecell;
